import base64
import os
import sys

import fitz  # PyMuPDF
from PyQt6.QtCore import Qt
from PyQt6.QtGui import QIcon, QImage, QPixmap
from PyQt6.QtWidgets import (QApplication, QComboBox, QFileDialog, QGridLayout,
                             QHBoxLayout, QLabel, QLineEdit, QMainWindow,
                             QMessageBox, QPushButton, QScrollArea,
                             QVBoxLayout, QWidget)


class PDFViewer(QMainWindow):
    def __init__(self, file_path):
        super().__init__()
        self.file_path = file_path
        self.doc = fitz.open(file_path)
        self.current_page = 0
        self.zoom = 1.0
        self.pages_per_view = 1
        self.search_results = []
        self.current_search_index = 0

        self.init_ui()
        self.display_pages()

    def init_ui(self):
        self.setWindowTitle(f"EncorPDF Viewer - {os.path.basename(self.file_path)}")
        self.setGeometry(100, 100, 1000, 800)

        # A√±adir √≠cono en base64 si est√° disponible
        if self.icon_base64.strip():
            self.setWindowIcon(self.add_base64_icon(self.icon_base64))

        # Central widget
        central_widget = QWidget()
        self.setCentralWidget(central_widget)

        # Main layout
        main_layout = QVBoxLayout()
        central_widget.setLayout(main_layout)

        # Establecer colores oscuros en la interfaz
        self.setStyleSheet("background-color: #2e2e2e; color: white;")

        # √Årea de visualizaci√≥n PDF
        self.scroll_area = QScrollArea()
        self.scroll_area.setAlignment(Qt.AlignmentFlag.AlignCenter)
        main_layout.addWidget(self.scroll_area)

        # Contenedor de PDF
        self.pdf_container = QWidget()
        self.pdf_layout = QGridLayout()
        self.pdf_container.setLayout(self.pdf_layout)
        self.scroll_area.setWidget(self.pdf_container)
        self.scroll_area.setWidgetResizable(True)

        # Controles
        controls_layout = QVBoxLayout()
        main_layout.addLayout(controls_layout)

        # Botones de navegaci√≥n
        nav_layout = QHBoxLayout()
        controls_layout.addLayout(nav_layout)

        buttons = [
            ("üîç Zoom -", self.zoom_out),
            ("üîç Zoom +", self.zoom_in),
            ("‚Ü∫ Rotar Izq", self.rotate_left),
            ("‚Üª Rotar Der", self.rotate_right),
            ("‚Üê Pag. Anterior", self.prev_page),
            ("Pag. Siguiente ‚Üí", self.next_page)
        ]
        for text, func in buttons:
            btn = QPushButton(text)
            self.set_button_style(btn)
            btn.clicked.connect(func)
            nav_layout.addWidget(btn)

        # Selecci√≥n de disposici√≥n de p√°ginas
        self.layout_combo = QComboBox()
        self.layout_combo.addItems(["1 P√°gina", "2 P√°ginas", "4 P√°ginas"])
        self.layout_combo.currentIndexChanged.connect(self.change_layout)
        nav_layout.addWidget(self.layout_combo)

        # Campo de entrada de p√°gina
        self.goto_input = QLineEdit()
        self.goto_input.setPlaceholderText("P√°gina #")
        self.goto_input.setFixedWidth(60)
        nav_layout.addWidget(self.goto_input)

        goto_btn = QPushButton("üîÑ Ir")
        self.set_button_style(goto_btn)
        goto_btn.clicked.connect(self.goto_page)
        nav_layout.addWidget(goto_btn)

        self.page_label = QLabel(f"P√°g: 1/{len(self.doc)}")
        nav_layout.addWidget(self.page_label)

        # B√∫squeda de texto
        search_layout = QHBoxLayout()
        controls_layout.addLayout(search_layout)

        self.search_input = QLineEdit()
        self.search_input.setPlaceholderText("Buscar texto")
        search_layout.addWidget(self.search_input)

        search_btn = QPushButton("üîé Buscar")
        self.set_button_style(search_btn)
        search_btn.clicked.connect(self.search_text)
        search_layout.addWidget(search_btn)

        next_result_btn = QPushButton("Siguiente Resultado")
        self.set_button_style(next_result_btn)
        next_result_btn.clicked.connect(self.next_search_result)
        search_layout.addWidget(next_result_btn)

    def set_button_style(self, button):
        button.setStyleSheet("""
            QPushButton {
                background-color: #444;
                color: white;
                border: 1px solid #555;
                border-radius: 6px;
                padding: 8px 16px;
            }
            QPushButton:hover {
                background-color: #666;
            }
            QPushButton:pressed {
                background-color: #222;
            }
        """)

    @staticmethod
    def add_base64_icon(b64_string):
        try:
            pixmap = QPixmap()
            pixmap.loadFromData(base64.b64decode(b64_string))
            return QIcon(pixmap)
        except Exception:
            return QIcon()

    icon_base64 = """"""  # Aqu√≠ puedes agregar el valor Base64 del icono

    def render_page(self, page_number):
        try:
            page = self.doc[page_number]
            mat = fitz.Matrix(self.zoom, self.zoom)
            pix = page.get_pixmap(matrix=mat)
            qimage = QImage(pix.samples, pix.width, pix.height, pix.stride, QImage.Format.Format_RGB888)
            return QPixmap.fromImage(qimage)
        except Exception as e:
            QMessageBox.critical(self, "Error", f"No se pudo renderizar la p√°gina: {e}")
            return None

    def display_pages(self):
        for i in reversed(range(self.pdf_layout.count())):
            widget = self.pdf_layout.itemAt(i).widget()
            if widget:
                widget.deleteLater()

        rows, cols = (1, 1)
        if self.pages_per_view == 2:
            rows, cols = (1, 2)
        elif self.pages_per_view == 4:
            rows, cols = (2, 2)

        for i in range(rows):
            for j in range(cols):
                page_index = self.current_page + i * cols + j
                if page_index < len(self.doc):
                    pixmap = self.render_page(page_index)
                    if pixmap:
                        page_label = QLabel()
                        page_label.setPixmap(pixmap)
                        page_label.setAlignment(Qt.AlignmentFlag.AlignCenter)
                        self.pdf_layout.addWidget(page_label, i, j)

        self.page_label.setText(f"P√°g: {self.current_page + 1}/{len(self.doc)}")

    def next_page(self):
        if self.current_page + self.pages_per_view < len(self.doc):
            self.current_page += self.pages_per_view
            self.display_pages()

    def prev_page(self):
        if self.current_page >= self.pages_per_view:
            self.current_page -= self.pages_per_view
            self.display_pages()

    def zoom_in(self):
        self.zoom += 0.2
        self.display_pages()

    def zoom_out(self):
        if self.zoom > 0.4:
            self.zoom -= 0.2
            self.display_pages()

    def goto_page(self):
        try:
            page_number = int(self.goto_input.text()) - 1
            if 0 <= page_number < len(self.doc):
                self.current_page = page_number
                self.display_pages()
            else:
                QMessageBox.warning(self, "P√°gina Inv√°lida", "N√∫mero fuera de rango.")
        except ValueError:
            QMessageBox.warning(self, "Entrada Inv√°lida", "Ingrese un n√∫mero v√°lido.")

    def change_layout(self):
        layout_text = self.layout_combo.currentText()
        self.pages_per_view = {"1 P√°gina": 1, "2 P√°ginas": 2, "4 P√°ginas": 4}.get(layout_text, 1)
        self.display_pages()

    def rotate_left(self):
        """Rota la p√°gina actual 90 grados a la izquierda (en sentido antihorario)."""
        for i in range(self.pages_per_view):
            page_index = self.current_page + i
            if page_index < len(self.doc):
                self.doc[page_index].set_rotation((self.doc[page_index].rotation - 90) % 360)
        self.display_pages()

    def rotate_right(self):
        """Rota la p√°gina actual 90 grados a la derecha (en sentido horario)."""
        for i in range(self.pages_per_view):
            page_index = self.current_page + i
            if page_index < len(self.doc):
                self.doc[page_index].set_rotation((self.doc[page_index].rotation + 90) % 360)
        self.display_pages()

    def search_text(self):
        keyword = self.search_input.text()
        if not keyword:
            QMessageBox.warning(self, "Error", "Ingrese texto para buscar.")
            return

        self.search_results = [p for p in range(len(self.doc)) if keyword.lower() in self.doc[p].get_text().lower()]
        if self.search_results:
            self.current_page = self.search_results[0]
            self.display_pages()
        else:
            QMessageBox.information(self, "Resultados", "No se encontraron coincidencias.")

    def next_search_result(self):
        if self.search_results:
            self.current_search_index = (self.current_search_index + 1) % len(self.search_results)
            self.current_page = self.search_results[self.current_search_index]
            self.display_pages()

    def export_page_as_image(self):
        try:
            pixmap = self.render_page(self.current_page)
            if pixmap:
                options = QFileDialog.Options()
                file_path, _ = QFileDialog.getSaveFileName(self, "Guardar Imagen", "", "Archivos PNG (*.png);;Archivos JPEG (*.jpg)", options=options)
                if file_path:
                    pixmap.save(file_path)
                    QMessageBox.information(self, "√âxito", "P√°gina exportada exitosamente.")
        except Exception as e:
            QMessageBox.critical(self, "Error", f"No se pudo exportar la p√°gina: {e}")


if __name__ == "__main__":
    app = QApplication(sys.argv)

    # Verificar si el archivo PDF se pasa como argumento al ejecutar el programa
    if len(sys.argv) > 1:
        file_path = sys.argv[1]  # Obtener el archivo desde el argumento
        viewer = PDFViewer(file_path)
        viewer.show()
        sys.exit(app.exec())  # Ejecutar la aplicaci√≥n hasta que se cierre
    else:
        # Si no se pasa el archivo como argumento, abrir el cuadro de di√°logo
        file_dialog = QFileDialog()
        file_path, _ = file_dialog.getOpenFileName(None, "Seleccionar PDF", "", "Archivos PDF (*.pdf)")

        if file_path:
            viewer = PDFViewer(file_path)
            viewer.show()
            sys.exit(app.exec())  # Ejecutar la aplicaci√≥n hasta que se cierre
        else:
            print("No se seleccion√≥ ning√∫n archivo.")

